import firstDog from "./dog-1.jpeg";
import secondDog from "../images/dog-2.jpeg";
import thirdDog from "../images/dog-3.jpeg";
const blogs = [
  {
    id: 1,
    image: { firstDog },
    date: "24 Jan 2024",
    bHeading: (
      <div>
        Finding your perfect <br /> dog breed
      </div>
    ),
  },
  {
    id: 2,
    image: { secondDog },
    date: "23 Jan 2024",
    bHeading: (
      <div>
        5 signs that it's time to <br /> change your dog's diet
      </div>
    ),
  },
  {
    id: 3,
    image: { thirdDog },
    date: "21 Jan 2024",
    bHeading: (
      <div>
        Taking care of your <br /> dog's joints
      </div>
    ),
  },
];
export default blogs;
